import "./ExpenseItemList.css"
import ExpenseItem from "./ExpenseItem";

function ExpenseItemList(props) {
  let expenseItemsJsx = [];

  for (const item in props.expenseItems)

  props.expenseItems.forEach((item, i) => {
    expenseItemsJsx.push(
      <ExpenseItem
        title={item[i].title}
        amount={item[i].amount}
        date={item[i].date}
      />
    );
  });

  return <div className="expenses">{expenseItemsJsx}</div>;
}

export default ExpenseItemList;
